import React from "React";

function FormComponent(props){
  return (
    <form>
      <input
        type="radio"
        name="training"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Training
      <br />
        <input
          type="radio"
          name="climbing"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Climbing
      <br />
        <input
          type="radio"
          name="indoor"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Indoor
        <br />
          <input
            type="radio"
            name="outdoor"
            //checked={placeholder}
            //onChange={[placeholder]}
          /> Outdoor
        <br />

    </form>
  )
}

export default FormCompnent
